let productsPrices = [];
cy.visit("/");
_HomePage.default.getProductsLink().click();
_AllProductsPage.default.getProductsList().each((product, index) => {
  if (index + 1 <= 2) {
    cy.wrap(product).then(() => {
      cy.wrap(product).find(`.productinfo h2`).invoke("text").then(text => {
        productsPrices.push(text);
      });
      _AllProductsPage.default.getOverlayAddToCartBtn(index + 1).click({
        force: true
      });
      if (index + 1 !== 2) {
        _AllProductsPage.default.getContinueShoppingBtn().click();
      } else _AllProductsPage.default.getModalViewCartBtn().click();
    });
  } else return false;
});
_CartPage.default.getCartTable().find("tbody tr").should("have.length", 2).each((element, index) => {
  cy.wrap(element).find(".cart_price p").should("contain", productsPrices[index]);
  cy.wrap(element).find(`.cart_quantity button`).should("contain", "1");
  cy.wrap(element).find(".cart_total p").should("contain", productsPrices[index]);
});

