let product = "";
const quantity = 4;
cy.visit("/");
_HomePage.default.getProductsLink().click();
_AllProductsPage.default.getProductsList().first().then(() => {
  _AllProductsPage.default.getViewProductBtn().first().click();
});
_SingleProductPage.default.getProductInformation().should("be.visible");
_SingleProductPage.default.getProductName().invoke("text").then(text => {
  product = text;
});
_SingleProductPage.default.getProductQuantity().clear().type(quantity);
_SingleProductPage.default.getAddToCartBtn().click();
_SingleProductPage.default.getModalViewCartBtn().click();
_CartPage.default.getCartTable().find("tbody tr").should("have.length", 1);
_CartPage.default.getCartTable().find(".cart_description a").invoke("text").then(text => {
  cy.wrap(text).should("contain", product);
});
_CartPage.default.getCartTable().find(".cart_quantity button").invoke("text").then(text => {
  cy.wrap(text).should("contain", quantity);
});

cy.visit(`/`);
cy.verifyTitle("Automation Exercise");
_HomePage.default.getProductsLink().click();
cy.verifyTitle("Automation Exercise - All Products");
_AllProductsPage.default.getProductsList().first().then(() => {
  _AllProductsPage.default.getAddToCartBtn().first().click();
});
_AllProductsPage.default.getModalViewCartBtn().click();
cy.verifyTitle("Automation Exercise - Checkout");
_CartPage.default.getCartTable().find("tbody tr").should("have.length", 1);
_CartPage.default.getCartTable().find(".cart_quantity_delete").click();
_CartPage.default.getEmptyCartMsg().should("contain", "Cart is empty!");

let productName = "";
cy.visit(`/`);
cy.verifyTitle("Automation Exercise");
_HomePage.default.getRecommendedItems().scrollIntoView();
_HomePage.default.getRecommendedItemsTitle().should("contain", "recommended items");
_HomePage.default.getFirstRecommendedItem().find("p").invoke("text").then(text => {
  productName = text;
  console.log(productName);
});
_HomePage.default.getFirstRecommendedItemCartBtn().click({
  force: true
});
_HomePage.default.getModalViewCartBtn().click();
_CartPage.default.getCartTable().find("tbody tr").should("have.length", 1);
_CartPage.default.getCartTable().find(".cart_description a").invoke("text").then(text => {
  cy.wrap(text).should("contain", productName);
});
